var suggestions=document.getElementById('suggestions');var userinput=document.getElementById('userinput');document.addEventListener('keydown',inputFocus);function inputFocus(e){if(e.keyCode===191){e.preventDefault();userinput.focus();}
if(e.keyCode===27){userinput.blur();suggestions.classList.add('d-none');}}
document.addEventListener('click',function(event){var isClickInsideElement=suggestions.contains(event.target);if(!isClickInsideElement){suggestions.classList.add('d-none');}});document.addEventListener('keydown',suggestionFocus);function suggestionFocus(e){const focusableSuggestions=suggestions.querySelectorAll('a');const focusable=[...focusableSuggestions];const index=focusable.indexOf(document.activeElement);let nextIndex=0;if(e.keyCode===38){e.preventDefault();nextIndex=index>0?index-1:0;focusableSuggestions[nextIndex].focus();}
else if(e.keyCode===40){e.preventDefault();nextIndex=index+1<focusable.length?index+1:index;focusableSuggestions[nextIndex].focus();}}
(function(){var index=new FlexSearch({preset:'score',cache:true,doc:{id:'id',field:['title','description','content',],store:['href','title','description',],},});var docs=[{id:0,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/introduction/",title:"Introducción",description:"Introducción funcional al nuevo sistema de promociones comerciales.",content:""},{id:1,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/introduction/",title:"Introducción",description:"Introducción funcional al nuevo sistema de promociones comerciales.",content:"\u003cp\u003eDisfrutá de estas hermosas promos! \u003cimg src=\"promo.jpg\" alt=\"etiquetas de promociones\"\u003e\u003c/p\u003e\n\u003ch2 id=\"crear-promociones-comerciales\"\u003eCrear promociones comerciales\u003c/h2\u003e\n\u003cp\u003eCon esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets. \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/crear-promos/\"\u003eCrear →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"buscar-promociones-comerciales\"\u003eBuscar promociones comerciales\u003c/h2\u003e\n\u003cp\u003eCon esta funcionalidad podrás buscar las promociones comerciales que se hayan generado anteriormente. \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/buscar-promos/\"\u003eBuscar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"editar-promociones-comerciales\"\u003eEditar promociones comerciales\u003c/h2\u003e\n\u003cp\u003eCon esta funcionalidad puedes realizar los cambios que consideres necesarios tanto en la información general de una promoción, como en sus reglas o criterios relacionados. \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/editar-promos/\"\u003eEditar →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"consultar-tickets\"\u003eConsultar tickets\u003c/h2\u003e\n\u003cp\u003eCon esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets. \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/reportes/consultar-tickets/\"\u003eBuscar tickets\u003c/a\u003e\u003c/p\u003e\n"},{id:2,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/crear-promos/",title:"Crear promociones comerciales",description:"Con esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono correspondiente para que puedas acceder a la pantalla \u0026ldquo;Promociones comerciales\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eHaz clic en el botón \u003cstrong\u003e+ NUEVA PROMOCIÓN\u003c/strong\u003e para comenzar.\u003c/li\u003e\n\u003cli\u003eEn la pantalla “Nueva promoción”, comienza a completar los campos con los datos de la promoción que quieres crear. Selecciona en primer lugar si el descuento va a corresponder a un monto fijo o un porcentaje.\u003c/li\u003e\n\u003cli\u003eLuego, completa el nombre y descripción, selecciona el tipo de estudiante, el período y la validez de la promoción.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa definición del tipo de estudiante llamado \"Nuevo inscripto\" hace referencia a un estudiante que acaba de ingresar a la carrera. Mientras que el término \"Re-inscripto\" abarca a aquellos estudiantes que han cursado esa carrera anteriormente.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eActiva la promoción deslizando el botón de \u0026ldquo;Estado\u0026rdquo; hacia la derecha. Para desactivarlo, deslízalo hacia la izquierda. Si se encuentra marcado en verde significa que la promoción está activa.\u003c/li\u003e\n\u003cli\u003eEn la pestaña \u0026ldquo;Tickets\u0026rdquo; puedes optar por el tipo de arancel y tickets a los que afectará esta promoción.\u003c/li\u003e\n\u003cli\u003eDirígete a la pestaña \u0026ldquo;Criterios\u0026rdquo; (ubicada a la derecha de “Tickets”). Aquí podrás configurar las reglas que se considerarán para hacer efectivo el descuento.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLos criterios que definas aquí indican a quiénes aplica y cuál es el monto o porcentaje de la promoción. Por eso es importante aclarar que cada regla \"incluye\" la población destino y al mismo tiempo \"excluye\" al resto de las opciones que no se han mencionado en esa definición. Entonces, si no se definen criterios, la promoción aplica a \"todos\". En cambio, si se incluye al menos una combinación para un segmento de población, habrá que configurar entonces qué sucede con el resto de las opciones que quedan automáticamente excluidas. Para más detalles, ve a la siguiente nota.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003eHaz clic en el icono de \u0026ldquo;Entradas\u0026rdquo; para elegir la población para quiénes aplican estas reglas. Puedes optar entre: Región, Modalidad, SubModalidad, Clase estudio, Carrera, Sede/CAU, Turno, Marca y Paquete. Todas estas opciones tienen listas desplegables.\u003c/li\u003e\n\u003cli\u003eEn las columnas de salida, dentro del campo \u0026ldquo;Valor\u0026rdquo; puedes definir el monto de la promoción o el valor del porcentaje dependiendo del tipo de promoción seleccionado.\u003c/li\u003e\n\u003cli\u003eSi deseas configurar esta promoción para que su aplicación abarque diferentes opciones de población, tendrás que seleccionar el botón \u003cstrong\u003e+ AGREGAR\u003c/strong\u003e y definir estos valores para todos los escenarios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas reglas se aplican con un orden de prioridad de arriba hacia abajo. Puedes agregar tantas reglas como desees. Las siguientes acciones están disponibles en esta grilla:\n\u003cbr\u003e\n\n\u003cb\u003eClonar\u003c/b\u003e: si una regla ya está definida, al hacer clic en este icono puedes copiar debajo exactamente la misma información.\n\u003cbr\u003e\n\n\u003cb\u003eOrdenar\u003c/b\u003e: cuando tengas varias reglas y quieras asignarles un nuevo orden en la grilla, puedes hacer clic en este ícono en el renglón de la regla que deseas mover y arrastrarla hacia su nuevo lugar. La herramienta te informa acerca de esta posibilidad con un mensaje en la parte inferior de la grilla.\n\u003cbr\u003e\n\n\u003cb\u003eEliminar\u003c/b\u003e: usa este botón para eliminar una regla.\n\u003cbr\u003e\n\nPor último, si has incluido varios criterios, será necesario que en la última fila definas cómo se aplicará la promoción a la parte de la población excluida. Si colocas un cero en el campo valor, esto significa que no se desea incluir ningún otro tipo de población a la promoción y si ingresas otro valor (por ejemplo, cinco) este descuento será aplicado al resto de la población que se excluyó en los criterios anteriores.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"12\"\u003e\n\u003cli\u003eUna vez definidos los datos generales de la promoción, los tickets asociados y las reglas o criterios de aplicación haz clic en el botón \u003cstrong\u003eGuardar.\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003c!-- \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/buscar-promos/\"\u003eBuscar promociones comerciales\u003c/a\u003e\n\u003c/br\u003e\n\n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/editar-promos/\"\u003eEditar promociones comerciales\u003c/a\u003e --\u003e\n"},{id:3,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/medios-pago/consultar-mediosdepago/",title:"Consultar medios de pago",description:"Con esta funcionalidad podrás buscar los medios de pagos vigentes.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono relacionado para que puedas acceder a la pantalla \u0026ldquo;Medios de pago\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior puedes comenzar a completar el campo de búsqueda con el nombre del medio de pago cuyos detalles deseas ver.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa grilla de búsqueda se irá filtrando automáticamente dependiendo del nombre que ingreses en el campo de búsqueda. Puedes utilizar el icono a la izquierda de los registros para arrastrar los medios de pagos y ubicarlos en el orden que desees.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003c!-- \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/medios-pago/editar-mediosdepago/\"\u003eEditar medios de pago\u003c/a\u003e --\u003e\n"},{id:4,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-financieras/consultar-promosfinancieras/",title:"Consultar promociones financieras",description:"Con Paypertic puedes ver los detalles de las promociones financieras que se aplicarán a los tickets dependiendo de los medios de pago que se elijan.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el primer icono para que puedas acceder a la pantalla \u0026ldquo;Promociones financieras\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior, ingresa en nombre de la promoción cuyos detalles deseas consultar.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLa grilla de búsqueda se irá filtrando automáticamente dependiendo del nombre que ingreses en el campo de búsqueda. En los títulos de las columnas de la grilla puedes usar las flechas para ordenar los datos de manera ascendente o descendente. Desde esta grilla también puedes activar o desactivar una promoción. Además, al hacer clic en el icono de lápiz podrás editar los datos de la promoción seleccionada.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eEn los campos disponibles en la grilla puedes ver los detalles de las promociones como: medio de pago, tasa de interés (si no hay interés, entonces se verá el campo vacío) y cantidad de cuotas disponibles.\u003c/li\u003e\n\u003cli\u003eSi te desplazas hacia abajo hasta el final de la grilla, podrás ver un botón \u003cstrong\u003eVER PROMOCIONES INACTIVAS\u003c/strong\u003e que te servirá para acceder a aquellas promociones que ya no están vigentes al final de la tabla debajo de aquellas promociones que sí están activas.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003c!-- \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-financieras/editar-promosfinancieras/\"\u003eEditar promociones financieras\u003c/a\u003e --\u003e\n"},{id:5,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-financieras/editar-promosfinancieras/",title:"Editar promociones financieras",description:"Con esta herramienta puedes configurar promociones financieras que se aplicarán a los tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el primer icono para que puedas acceder a la pantalla \u0026ldquo;Promociones financieras\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior, ingresa en nombre de la promoción cuya configuración deseas editar.\u003c/li\u003e\n\u003cli\u003eEn la ventana \u0026ldquo;Detalles de la promoción\u0026rdquo;, ve a la sección \u0026ldquo;Reglas/Criterios\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de \u0026ldquo;Entradas\u0026rdquo; para elegir la población para quiénes aplican estas reglas. Puedes optar entre: Tipo de producto, Región, Modalidad, SubModalidad, Clase estudio, Carrera, Sede/CAU, Rol, Tipo de alumno, Período y Paquete. Todas estas opciones tienen listas desplegables.\u003c/li\u003e\n\u003cli\u003ePresiona el botón para activar la promoción y si deseas agrega una nota.\u003c/li\u003e\n\u003cli\u003eSi deseas configurar esta promoción para que su aplicación abarque diferentes opciones de población, tendrás que seleccionar el botón \u003cstrong\u003e+ AGREGAR\u003c/strong\u003e y definir estos valores para todos los escenarios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas reglas se aplican con un orden de prioridad de arriba hacia abajo. Puedes agregar tantas reglas como desees. Las siguientes acciones están disponibles en esta grilla:\n\u003cbr\u003e\n\n\u003cb\u003eClonar\u003c/b\u003e: si una regla ya está definida, al hacer clic en este icono puedes copiar debajo exactamente la misma información.\n\u003cbr\u003e\n\n\u003cb\u003eOrdenar\u003c/b\u003e: cuando tengas varias reglas y quieras asignarles un nuevo orden en la grilla, puedes hacer clic en este ícono en el renglón de la regla que deseas mover y arrastrarla hacia su nuevo lugar. La herramienta te informa acerca de esta posibilidad con un mensaje en la parte inferior de la grilla.\n\u003cbr\u003e\n\n\u003cb\u003eEliminar\u003c/b\u003e: usa este botón para eliminar una regla.\n\u003cbr\u003e\n\nPor último, si has incluido varios criterios, será necesario que en la última fila definas cómo se aplicará la promoción a la parte de la población excluida. Si colocas un cero en el campo valor, esto significa que no se desea incluir ningún otro tipo de población a la promoción y si ingresas otro valor (por ejemplo, cinco) este descuento será aplicado al resto de la población que se excluyó en los criterios anteriores.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez definidos las reglas o criterios de aplicación haz clic en el botón \u003cstrong\u003eGuardar.\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003c!-- \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-financieras/consultar-promosfinancieras/\"\u003eConsultar promociones financieras\u003c/a\u003e --\u003e\n"},{id:6,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/buscar-promos/",title:"Buscar promociones comerciales",description:"Con esta funcionalidad podrás buscar las promociones comerciales que se hayan generado anteriormente.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono relacionado para que puedas acceder a la pantalla \u0026ldquo;Promociones comerciales\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior puedes comenzar a completar los campos con algunos datos de las promociones que deseas ver.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDependiendo de las opciones que seleccionas en los filtros, algunos datos se volverán obligatorios.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003ePor último, presiona \u003cstrong\u003eBuscar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eLos resultados de la búsqueda se verán en el listado en la parte inferior de la pantalla.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEn los títulos de las columnas de la grilla puedes usar las flechas para ordenar los datos de manera ascendente o descendente. Desde esta grilla también puedes activar o desactivar una promoción. Además, al hacer clic en el icono de lápiz podrás editar los datos de la promoción seleccionada. \u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003c!-- \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/crear-promos/\"\u003eCrear promociones comerciales\u003c/a\u003e\n\u003cbr/\u003e\n\n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/editar-promos/\"\u003eEditar promociones comerciales\u003c/a\u003e --\u003e\n"},{id:7,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes-qbit/rendir/",title:"Rendir un examen",description:"Con esta funcionalidad podrás llevar a cabo las instancias de evaluación para las que te has inscripto.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta para rendir exámenes.\u003c/li\u003e\n\u003cli\u003eEn la primer pantalla verás la lista de exámenes a los que te has inscripto y que tienes disponible para rendir.\u003c/li\u003e\n\u003cli\u003ePresiona el botón \u003cstrong\u003eHABILITAR\u003c/strong\u003e para continuar hacia la instancia de evaluación. En la grilla verás que el estado del examen es creado. Esta opción de habilitar se asocia con validaciones que pueden relacionarse con la aprobación de algún profesor o la autenticación de ciertos datos que identifiquen que quien está a punto de rendir el examen es quién acredita ser.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi haces clic en \u003cb\u003eREPORTE\u003c/b\u003e podrás ver un resumen de tu historial de notas.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eEn la pantalla del examen que seleccionaste podrás distinguir las siguientes secciones:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cul\u003e\n\u003cli\u003eEn la parte superior izquierda verás tu nombre y el de la materia. En la parte superior derecha podrás ir controlando mientras realizas el examen el tiempo transcurrido desde que comenzaste con esta instancia de evaluación y la cantidad de preguntas que has respondido.\u003c/li\u003e\n\u003cli\u003eEn el centro en la parte superior de la pantalla encontrarás un carrusel con botones que contienen un icono de información y la cantidad de enunciados que se incluyen en la evaluación (por defecto podrás ver 10 preguntas y si hubiese más deberás hacer clic en la flecha que señala que hay más preguntas a la derecha). Los números de las preguntas cambiarán de color dependiendo de ciertas circunstancias. Cuando posas el cursor sobre el icono de información se despliegan los colores con sus respectivas referencias: enunciados con respuesta, sin respuesta, marcados para repasar y el que se está viendo en la pantalla.\u003c/li\u003e\n\u003c/ul\u003e\n\u003col start=\"5\"\u003e\n\u003cli\u003eEn recuadro al centro de la pantalla comenzarás a ver los enunciados o preguntas que conforman el examen.\u003c/li\u003e\n\u003cli\u003eSelecciona la o las respuestas que consideres correctas.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eDebajo de las respuestas puedes activar la opción **Repasar respuesta**. Si lo haces, antes de finalizar el examen el sistema te alertará que marcaste estas respuestas para repasar.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eUna vez que hayas respondido, haz clic en \u003cstrong\u003eSIGUIENTE\u003c/strong\u003e para continuar con la siguiente pregunta.\u003c/li\u003e\n\u003cli\u003eRepite estas acciones en todos los enunciados.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi haces clic en \u003cb\u003eANTERIOR\u003c/b\u003e podrás regresar a las preguntas anteriores. En caso de que la conexión o la energía eléctrica se interrumpan, cuando los servicios se vuelvan a restablecer y puedas abrir la herramienta para rendir exámenes presiona en botón \u003cb\u003eCONTINUAR RINDIENDO\u003c/b\u003e. Dependiendo de la configuración del examen serán las veces que puedas reintentar continuar con la evaluación. Si llegas al límite máximo de intentos el sistema te alertará y dará por finalizado el examen.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"9\"\u003e\n\u003cli\u003e\n\u003cp\u003eUna vez que termines de repasar y revisar, haz clic en el botón \u003cstrong\u003eFINALIZAR EXAMEN\u003c/strong\u003e. Si el sistema detecta preguntas sin respuesta o marcadas para repasar que no han sido confirmadas, te alertará con un mensaje para que puedas reverlas o finalizar el examen de todos modos.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eLuego de haber finalizado el examen, podrás comenzar con la etapa de revisión de las preguntas cuyas respuestas fueron incorrectas. En la pantalla verás un resumen de la cantidad de respuestas correctas e incorrectas y para las que hayan sido configuradas de esa manera su justificación de por qué la opción que elegiste no califica como correcta.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi consideras conveniente puedes pedir a un profesor que revise tu respuesta dslizando la el botón para solicitar su revisión. Además deberás agregar el motivo de esta solicitud. El sistema alertará al profesor que corresponda que tiene una pregunta por revisar de un alumno.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"11\"\u003e\n\u003cli\u003ePor último, podrás hacer clic en \u003cstrong\u003eFINALIZAR REVISIÓN\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEl sistema mostrará el resultado del examen con la nota que obtuviste y con un resumen de la cantidad de respuestas correctas, incorrectas y sin respuesta.\u003c/li\u003e\n\u003c/ol\u003e\n"},{id:8,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/medios-pago/editar-mediosdepago/",title:"Editar medios de pago",description:"Con esta herramienta puedes configurar promlos medios de pago que se utilizarán al momento de realizar el pago de un tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono relacionado para que puedas acceder a la pantalla \u0026ldquo;Medios de pago\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior ingresa el nombre del medio de pago que deseas editar para que lo puedas ver en la grilla.\u003c/li\u003e\n\u003cli\u003eHaz clic en el nombre del medio de pago cuya información deseas modificar.\u003c/li\u003e\n\u003cli\u003eLa pantalla \u0026ldquo;Detalle de los medios de pago\u0026rdquo; se abrirá. Aquí, haz clic en \u003cstrong\u003eEditar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eRealiza los cambios que creas necesarios vinculados con la información general.\u003c/li\u003e\n\u003cli\u003eUna vez que hayas finalizado, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEn la parte inferior de la pantalla, puedes configurar las reglas o criterios a los que va aplicar este medio de pago en particular.\u003c/li\u003e\n\u003cli\u003eHaz clic en el icono de \u0026ldquo;Entradas\u0026rdquo; para elegir la población para quiénes aplican estas reglas. Puedes optar entre: Tipo de producto, Clase estudio, Modalidad, SubModalidad, Carrera, Sede/CAU, Rol, Tipo de alumno, Período, Turno, Arancel completo y Promoción. Todas estas opciones tienen listas desplegables.\u003c/li\u003e\n\u003cli\u003ePresiona el botón para activar la promoción y si deseas agrega una nota.\u003c/li\u003e\n\u003cli\u003eSi deseas configurar esta promoción para que su aplicación abarque diferentes opciones de población, tendrás que seleccionar el botón \u003cstrong\u003e+ AGREGAR\u003c/strong\u003e y definir estos valores para todos los escenarios.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eLas reglas se aplican con un orden de prioridad de arriba hacia abajo. Puedes agregar tantas reglas como desees. Las siguientes acciones están disponibles en esta grilla:\n\u003cbr\u003e\n\n\u003cb\u003eClonar\u003c/b\u003e: si una regla ya está definida, al hacer clic en este icono puedes copiar debajo exactamente la misma información.\n\u003cbr\u003e\n\n\u003cb\u003eOrdenar\u003c/b\u003e: cuando tengas varias reglas y quieras asignarles un nuevo orden en la grilla, puedes hacer clic en este ícono en el renglón de la regla que deseas mover y arrastrarla hacia su nuevo lugar. La herramienta te informa acerca de esta posibilidad con un mensaje en la parte inferior de la grilla.\n\u003cbr\u003e\n\n\u003cb\u003eEliminar\u003c/b\u003e: usa este botón para eliminar una regla.\n\u003cbr\u003e\n\nPor último, si has incluido varios criterios, será necesario que en la última fila definas cómo se aplicará la promoción a la parte de la población excluida. Si colocas un cero en el campo valor, esto significa que no se desea incluir ningún otro tipo de población a la promoción y si ingresas otro valor (por ejemplo, cinco) este descuento será aplicado al resto de la población que se excluyó en los criterios anteriores.\u003c/div\u003e\n\u003c/div\u003e\n\u003col start=\"8\"\u003e\n\u003cli\u003eUna vez definidas las reglas o los criterios de aplicación, haz clic en el botón \u003cstrong\u003eGuardar.\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003c!-- \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/medios-pago/consultar-mediosdepago/\"\u003eConsultar medios de pagos\u003c/a\u003e --\u003e\n"},{id:9,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/editar-promos/",title:"Editar promociones comerciales",description:"Con esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets.",content:"\u003cdiv class=\"note note-warning\" role=\"note\"\u003e\n  \u003cdiv class=\"flex-shrink-1 note-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0V0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M11 7h2v2h-2zm0 4h2v6h-2zm1-9C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eNota\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eEstas acciones pueden realizarse desde la pantalla de búsqueda de promociones o desde la pantalla de consulta de tickets pendientes de pago mediante el icono de lápiz. Ve a los artículos relacionados al final de este documento.\u003c/div\u003e\n\u003c/div\u003e\n\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono relacionado para acceder a la pantalla \u0026ldquo;Promociones comerciales\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn la parte superior puedes ingresar los datos de la promoción que deseas editar.\u003c/li\u003e\n\u003cli\u003eEn la grilla con los resultados de la búsqueda, presiona el lápiz en la promoción deseada para acceder a la ventana de edición.\u003c/li\u003e\n\u003cli\u003eRealiza los cambios que sean necesarios.\u003c/li\u003e\n\u003cli\u003eCuando hayas finalizado, presiona \u003cstrong\u003eGuardar\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003c!-- \n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/crear-promos/\"\u003eCrear promociones comerciales\u003c/a\u003e\n\u003cbr/\u003e\n\n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/buscar-promos/\"\u003eBuscar promociones comerciales\u003c/a\u003e\n\u003cbr/\u003e\n\n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/reportes/consultar-tickets/\"\u003eConsultar tickets\u003c/a\u003e --\u003e\n"},{id:10,href:"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/reportes/consultar-tickets/",title:"Consultar tickets",description:"Con esta herramienta puedes configurar promociones comerciales que se aplicarán a los tickets.",content:"\u003col\u003e\n\u003cli\u003eIngresa a la herramienta de \u0026ldquo;Gestión de ingresos\u0026rdquo; ![etiquetas de promociones](./prueba/imagen/my pic.png).\u003c/li\u003e\n\u003cli\u003eEn el panel de navegación, selecciona el icono reportes para que puedas acceder a la pantalla de \u0026ldquo;Reporte de tickets\u0026rdquo;.\u003c/li\u003e\n\u003cli\u003eEn el campo \u0026ldquo;Ticket\u0026rdquo;, ingresa en número de ticket y presiona \u003cstrong\u003eBuscar\u003c/strong\u003e para ver sus detalles.\u003c/li\u003e\n\u003cli\u003eLa pantalla se actualizará con la información del ticket que deseas consultar. En el encabezado podrás ver: número de ticket, legajo del estudiante, fecha, descripción, cuota, período, sede/CAU, carrera, tipo de estudiante, promoción, precio del ticket y monto final.\u003c/li\u003e\n\u003cli\u003eEn la sección \u0026ldquo;Medios de pago\u0026rdquo;, selecciona un medio de pago para ver sus promociones financieras y compararlas con otros medios.\u003c/li\u003e\n\u003cli\u003eEn la sección \u0026ldquo;Promociones comerciales\u0026rdquo;, puedes ver la vinculación del ticket que seleccionaste con una promoción comercial.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"tip tip-warning\" role=\"tip\"\u003e\n  \u003cdiv class=\"flex-shrink-1 tip-icon\"\u003e\n    \u003csvg xmlns=\"http://www.w3.org/2000/svg\" height=\"20px\" viewBox=\"0 0 24 24\" width=\"20px\" fill=\"#fff\" class=\"icon\"\u003e\n      \u003cpath d=\"M0 0h24v24H0z\" fill=\"none\"/\u003e\n      \u003cpath d=\"M9 21c0 .55.45 1 1 1h4c.55 0 1-.45 1-1v-1H9v1zm3-19C8.14 2 5 5.14 5 9c0 2.38 1.19 4.47 3 5.74V17c0 .55.45 1 1 1h6c.55 0 1-.45 1-1v-2.26c1.81-1.27 3-3.36 3-5.74 0-3.86-3.14-7-7-7zm2.85 11.1l-.85.6V16h-4v-2.3l-.85-.6C7.8 12.16 7 10.63 7 9c0-2.76 2.24-5 5-5s5 2.24 5 5c0 1.63-.8 3.16-2.15 4.1z\"/\u003e\n    \u003c/svg\u003e\n    \u003cspan class=\"icon-title\"\u003eConsejo\u003c/span\u003e\n  \u003c/div\u003e\n  \u003cdiv class=\"w-100\"\u003eSi tienes los permisos necesarios, desde esta pantalla también puedes ver más detalles o editar las promociones comerciales haciendo clic en el icono de lápiz.\u003c/div\u003e\n\u003c/div\u003e\n\u003ch2 id=\"véase-también\"\u003eVéase también\u003c/h2\u003e\n\u003cp\u003e\n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/crear-promos/\"\u003eCrear promociones comerciales\u003c/a\u003e\n\u003cbr/\u003e\n\n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/editar-promos/\"\u003eEditar promociones comerciales\u003c/a\u003e\n\u003cbr/\u003e\n\n\n\u003ca class=\"link\" href=\"https://bitlogic.github.io/doks-algarrobo/docs/revenue-management/promos-comerciales/buscar-promos/\"\u003eBuscar promociones comerciales\u003c/a\u003e\u003c/p\u003e\n"},{id:11,href:"https://bitlogic.github.io/doks-algarrobo/docs/",title:"Docs",description:"Software project docs",content:""},{id:12,href:"https://bitlogic.github.io/doks-algarrobo/docs/examenes-qbit/",title:"Docs",description:"Software project docs",content:""},{id:13,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/cuenta/co-docente/consultar-cuenta/",title:"",description:null,content:""},{id:14,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/cuenta/estudiante/consultar-cuenta/",title:"",description:null,content:""},{id:15,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/editar-facturacion/editar-contacto/",title:"",description:null,content:""},{id:16,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/co-docente/consultar-historial/",title:"",description:null,content:""},{id:17,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/historial-pagos/estudiante/consultar-historial/",title:"",description:null,content:""},{id:18,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/co-docente/consultar-ticket/",title:"",description:null,content:""},{id:19,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/matricula-aranceles/estudiante/consultar-ticket/",title:"",description:null,content:""},{id:20,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/metodos-pago/consultar-formas-pago/",title:"",description:null,content:""},{id:21,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/otros/co-docente/realizar-otros-pagos/",title:"",description:null,content:""},{id:22,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/otros/estudiante/realizar-otros-pagos/",title:"",description:null,content:""},{id:23,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/co-docente/cargar-saldo/",title:"",description:null,content:""},{id:24,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/pagar-cuenta/estudiante/cargar-saldo/",title:"",description:null,content:""},{id:25,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-canales-contacto/",title:"",description:null,content:""},{id:26,href:"https://bitlogic.github.io/doks-algarrobo/docs/epagos/politicas-seguridad/consultar-politicas/",title:"",description:null,content:""},];index.add(docs);userinput.addEventListener('input',show_results,true);suggestions.addEventListener('click',accept_suggestion,true);function show_results(){var value=this.value;var results=index.search(value,5);var entry,childs=suggestions.childNodes;var i=0,len=results.length;suggestions.classList.remove('d-none');results.forEach(function(page){entry=document.createElement('div');entry.innerHTML='<a href><span></span><span></span></a>';a=entry.querySelector('a'),t=entry.querySelector('span:first-child'),d=entry.querySelector('span:nth-child(2)');a.href=page.href;t.textContent=page.title;d.textContent=page.description;suggestions.appendChild(entry);});while(childs.length>len){suggestions.removeChild(childs[i])}}
function accept_suggestion(){while(suggestions.lastChild){suggestions.removeChild(suggestions.lastChild);}
return false;}}());